    LANGUAGE plpgsql
    AS $$
   DECLARE
   alternativeId integer;
   esito text;
   BEGIN


   if NEW.trashed_date is null
   then
   if NEW.tipologia in(1,3,97,850,151,802,152,10,20,2,800,801) 
   then
	esito:=(select * from org_insert_into_ricerche_anagrafiche_old_materializzata(NEW.org_id));

