    LANGUAGE plpgsql
    AS $$
   DECLARE
   codiceUnivoco text;
   idNorma integer;
   mapCompleto boolean;
   BEGIN

idNorma := -1;
codiceUnivoco = '';
mapCompleto = false;

   if NEW.tipologia in(4,5,12,14,15,17,22,255) 
